package bidimensional;

public class Ejemplo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int[] [] num= new int[20] [5];
		for(int i=0; i<20;i++) {
			for (int j=0; i<5;i++) {
				System.out.println(num [i][j] + " ");
			}
			System.out.println();
		}
	}

}
